import React from 'react';
import './App.css';
import Login from './Components/login';
import CreateAccount from './Components/createAccount'
import Header from './Components/header'
function App() {
  return (
    <div className="App">
      <Header />
      <Login />
      <CreateAccount />
      
    </div>
  );
}

export default App;
